import styled from "styled-components";

export const TechForm = styled.form`
  @media (max-width: 780px) {
  }
  margin: 1 auto;
  width: 370px;
  min-height: 350px;
  input,
  label,
  small,
  button {
    width: 90%;
    margin: 8px 5%;
  }
`;
